INSERT INTO multimedias (id,nombre,calificacion,duracion,idDirector,sinopsis,fechaEstreno) VALUES(59,'corredores curtidores',1,'0horas 47minutos',658,'Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clasicos canciones de cuna y mitos griegos que estudian en una escuela-internado llamada Ever After High. En algunos casos los libros son escritos por Suzanne Selfors pero la mayoria de ellos suelen ser escritos por Hale ya que originalmente es la autora de la serie. Tecnicamente no es una serie de television en los Estados Unidos ya que es una serie Web. Sin embargo la serie es transmitida en la television de Francia por el canal infantil frances Gulli. Ever After High es considerada apta para todo el pblico',TO_DATE('7-11-1868','DD-MM-YYYY'));
