INSERT INTO capitulosSeries (id,idTemporada,idSerie,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES (0,0,1758,'desterrados','0horas 27minutos','Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clsicos, canciones de cuna y mitos griegos, que estudian en una escuela-internado, llamada Ever After High. En algunos casos, los libros son escritos por Suzanne Selfors, pero la mayora de ellos suelen ser escritos por Hale, ya que originalmente es la autora de la serie. Tcnicamente no es una serie de televisin en los Estados Unidos, ya que es una serie Web. Sin embargo la serie es transmitida en la televisin de Francia por el canal infantil francs, Gulli. Ever After High es considerada apta para todo el pblico',TO_DATE('1-3-1874','DD-MM-YYYY'),8);
INSERT INTO capitulosSeries (id,idTemporada,idSerie,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES (1,1,1703,'curtidores','0horas 42minutos','Antes de meterse en el mundo de la comedia estuvo trabajando en una compaa telefnica de Los ngeles. Su familia le pidi que siguiera en su puesto para poder mantenerse econmicamente, sin embargo decidi dar un paso adelante a pesar de los riesgos que acarreara su mala situacin econmica, puesto que acab perdiendo su casa y el coche',TO_DATE('5-9-1743','DD-MM-YYYY'),5);
INSERT INTO capitulosSeries (id,idTemporada,idSerie,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES (2,2,1740,'campesinos','0horas 26minutos','Desste segmento para hablar de las llamadas tendencias de moda entre los jvenes, tales como pipas de agua, el vino, el marketing de guerrilla y los videojuegos. El 22 de marzo de 2007, Demetri hizo otra aparicin en The Daily Show, hablando acerca de la demanda de Viacom contra Google y YouTube',TO_DATE('22-4-1843','DD-MM-YYYY'),6);
