INSERT INTO capitulosSeries (id,idTemporada,idSerie,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES (24,24,1232,'colegas','1horas 45minutos','BoJack Horsemg para la plataforma digital Netflix. Trata la historia de BoJack, un caballo antropomorfo que triunf en los aos 1990 con una telecomedia y que actualmente es incapaz de reconducir su vida profesional y personal. A travs de un marco ambientado en el mundo del espectculo de Hollywood, los episodios abordan complejos conflictos personales y tienen un hilo narrativo serializado',TO_DATE('14-4-1919','DD-MM-YYYY'),0);
