INSERT INTO capitulosSeries (id,idTemporada,idSerie,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES (71,71,1907,'campesinos','0horas 43minutos','Willd-up y por conducir Bill Burrs Monday Morning Podcast. Como actor interpret a Patrick Kuby en la serie Breaking Bad y protagoniz la sitcom animada F Is for Family. En 2017 la Rolling Stone lo coloc en el nmero diecisiete de los cincuenta mejores comediantes en vivo de todos los tiempos',TO_DATE('16-5-1997','DD-MM-YYYY'),9);
