INSERT INTO capitulosSeries (id,idTemporada,idSerie,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES (73,73,1058,'mejores','0horas 3minutos','Antes de meterse en el mundo de la comedia estuvo trabajando en una compaa telefnica de Los ngeles. Su familia le pidi que siguiera en su puesto para poder mantenerse econmicamente, sin embargo decidi dar un paso adelante a pesar de los riesgos que acarreara su mala situacin econmica, puesto que acab perdiendo su casa y el coche',TO_DATE('25-2-1788','DD-MM-YYYY'),9);
