INSERT INTO capitulosSeries (id,idTemporada,idSerie,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES (993,993,1594,'asesinos','0horas 35minutos','Antes de meterse en el mundo de la comedia estuvo trabajando en una compaa telefnica de Los ngeles. Su familia le pidi que siguiera en su puesto para poder mantenerse econmicamente, sin embargo decidi dar un paso adelante a pesar de los riesgos que acarreara su mala situacin econmica, puesto que acab perdiendo su casa y el coche',TO_DATE('16-8-1823','DD-MM-YYYY'),1);
