INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(1,2001,'curtidores pocos','2horas 20minutos','Ha gAllen. Martin volvi a The Daily Show el 22 de marzo de 2006, como el nuevo Corresponsal Juvenil, llamando a su segmento de Noticias Importantes Profesionales con Demetri Martin. En 2007, protagoniz el video musical de Fountains of Wayne, Someone to Love como Seth Shapiro, un personaje de la cancin junto a Faryl Millet',TO_DATE('20-8-1903','DD-MM-YYYY'),0);
