INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(3,2003,'estudiantes asesinos','4horas 21minutos','Willd-up y por conducir Bill Burrs Monday Morning Podcast. Como actor interpret a Patrick Kuby en la serie Breaking Bad y protagoniz la sitcom animada F Is for Family. En 2017 la Rolling Stone lo coloc en el nmero diecisiete de los cincuenta mejores comediantes en vivo de todos los tiempos',TO_DATE('28-11-1827','DD-MM-YYYY'),2);
