INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(13,2013,'desterrados lobos','1horas 40minutos','Un d consigue acompaarles y juntos se dirigen al imperio de Kublai Khan. Penurias y privaciones marcan el camino hasta que finalmente, tras varios aos, logran llegar a Mongolia y a la corte del Gran Khan. All se gana el respeto de Kublai, se hace amigo de Chinkin, el hijo de Kublai Khan, quien sufre de epilepsia',TO_DATE('19-9-1784','DD-MM-YYYY'),5);
