INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(76,2076,'mejores amigos','1horas 16minutos','Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clsicos, canciones de cuna y mitos griegos, que estudian en una escuela-internado, llamada Ever After High. En algunos casos, los libros son escritos por Suzanne Selfors, pero la mayora de ellos suelen ser escritos por Hale, ya que originalmente es la autora de la serie. Tcnicamente no es una serie de televisin en los Estados Unidos, ya que es una serie Web. Sin embargo la serie es transmitida en la televisin de Francia por el canal infantil francs, Gulli. Ever After High es considerada apta para todo el pblico',TO_DATE('19-6-1985','DD-MM-YYYY'),9);
INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(77,2077,'desterrados pitufos','3horas 1minutos','Antes de meterse en el mundo de la comedia estuvo trabajando en una compaa telefnica de Los ngeles. Su familia le pidi que siguiera en su puesto para poder mantenerse econmicamente, sin embargo decidi dar un paso adelante a pesar de los riesgos que acarreara su mala situacin econmica, puesto que acab perdiendo su casa y el coche',TO_DATE('28-5-1930','DD-MM-YYYY'),8);
