INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(120,2120,'galacticos asesinos','0horas 23minutos','Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clsicos, canciones de cuna y mitos griegos, que estudian en una escuela-internado, llamada Ever After High. En algunos casos, los libros son escritos por Suzanne Selfors, pero la mayora de ellos suelen ser escritos por Hale, ya que originalmente es la autora de la serie. Tcnicamente no es una serie de televisin en los Estados Unidos, ya que es una serie Web. Sin embargo la serie es transmitida en la televisin de Francia por el canal infantil francs, Gulli. Ever After High es considerada apta para todo el pblico',TO_DATE('22-7-1943','DD-MM-YYYY'),6);
