INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(458,2458,'amigos galacticos','0horas 16minutos','Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clsicos, canciones de cuna y mitos griegos, que estudian en una escuela-internado, llamada Ever After High. En algunos casos, los libros son escritos por Suzanne Selfors, pero la mayora de ellos suelen ser escritos por Hale, ya que originalmente es la autora de la serie. Tcnicamente no es una serie de televisin en los Estados Unidos, ya que es una serie Web. Sin embargo la serie es transmitida en la televisin de Francia por el canal infantil francs, Gulli. Ever After High es considerada apta para todo el pblico',TO_DATE('25-7-1703','DD-MM-YYYY'),6);
INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(459,2459,'corredores vampiros','3horas 22minutos','BoJack Horsemg para la plataforma digital Netflix. Trata la historia de BoJack, un caballo antropomorfo que triunf en los aos 1990 con una telecomedia y que actualmente es incapaz de reconducir su vida profesional y personal. A travs de un marco ambientado en el mundo del espectculo de Hollywood, los episodios abordan complejos conflictos personales y tienen un hilo narrativo serializado',TO_DATE('22-8-1913','DD-MM-YYYY'),2);
INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(460,2460,'peques amigos','4horas 57minutos','El Sunnyv rivalidades y la delincuencia estn al orden del da pero en la que tambin es posible formar una familia, tener amigos y encontrar el amor... siempre y cuando tenga uno claro que la familia le va a hacer la vida imposible, el amor le va a amargar la existencia y los amigos acabarn por llevarle a la tumba.',TO_DATE('21-4-1962','DD-MM-YYYY'),8);
