INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(504,2504,'mario vampiros','3horas 13minutos','En  convirti en un especial de televisin britnica en 2004. Desde 2003 hasta 2004, Martin escribi para Late Night with Conan O Brien. En 2004, Martin tena su propio Comedy Central Presents Stand-up especial. Su especial se divide en tres partes. En la primera, se realiza en forma tradicional stand-up',TO_DATE('6-2-1946','DD-MM-YYYY'),7);
