INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(599,2599,'pocajontas colegas','3horas 47minutos','Antes de meterse en el mundo de la comedia estuvo trabajando en una compaa telefnica de Los ngeles. Su familia le pidi que siguiera en su puesto para poder mantenerse econmicamente, sin embargo decidi dar un paso adelante a pesar de los riesgos que acarreara su mala situacin econmica, puesto que acab perdiendo su casa y el coche',TO_DATE('7-11-1985','DD-MM-YYYY'),3);
