INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(691,2691,'curtidores colegas','4horas 32minutos','BoJack Horsemg para la plataforma digital Netflix. Trata la historia de BoJack, un caballo antropomorfo que triunf en los aos 1990 con una telecomedia y que actualmente es incapaz de reconducir su vida profesional y personal. A travs de un marco ambientado en el mundo del espectculo de Hollywood, los episodios abordan complejos conflictos personales y tienen un hilo narrativo serializado',TO_DATE('13-2-1717','DD-MM-YYYY'),1);
INSERT INTO capitulosDocumentales (id,idDocumental,nombre,duracion,descripcion,fechaEstreno,numeroCapitulo) VALUES(692,2692,'colegas colegas','0horas 16minutos','Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clsicos, canciones de cuna y mitos griegos, que estudian en una escuela-internado, llamada Ever After High. En algunos casos, los libros son escritos por Suzanne Selfors, pero la mayora de ellos suelen ser escritos por Hale, ya que originalmente es la autora de la serie. Tcnicamente no es una serie de televisin en los Estados Unidos, ya que es una serie Web. Sin embargo la serie es transmitida en la televisin de Francia por el canal infantil francs, Gulli. Ever After High es considerada apta para todo el pblico',TO_DATE('13-7-1745','DD-MM-YYYY'),1);
